class SaveBatch {
    constructor(
      id = undefined,
      batchName,
      scenarioIdList = [],
      updatedBy = undefined,
      deltaComment = '',
      added = [],
      removed = []
    ) {
      this.id = id;
      this.batchName = batchName;
      this.scenarioIdList = scenarioIdList;
      this.updatedBy = updatedBy;
      this.deltaComment = deltaComment;
      this.added = added;
      this.removed = removed;
    }
  }
  
  export default SaveBatch;
  